import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header
      style={{
        backgroundColor: '#fdf9f9ff',
        color: '#8B0000',
        padding: '15px 20px',
        display: 'flex',
        justifyContent: 'flex-start', // left-align
        alignItems: 'center',
        flexWrap: 'wrap',
        gap: '20px',
      }}
    >
      <Link to="/about" style={linkStyle}>About</Link>
      <Link to="/varieties" style={linkStyle}>Varieties</Link>
      <Link to="/admin-login" style={linkStyle}>Admin Orders</Link>
    </header>
  );
}

const linkStyle = {
  color: '#8B0000',
  textDecoration: 'none',
  fontWeight: 'bold',
  fontSize: '16px',
  padding: '8px 12px',
  borderRadius: '5px',
  transition: 'background 0.3s ease',
};

export default Header;
